import Chart from "react-google-charts";
import { GlobalThemes } from "../../ThemeManager";

const EnterpriseTheme = ({}: {}) => {
  return (
    <div className={"contentContainer " + GlobalThemes.Enterprise}>
      <div className="pageLabel">
        <Chart
          width={"500px"}
          height={"300px"}
          chartType="PieChart"
          loader={<div>Loading Chart</div>}
          data={[
            ["Expense", "Cost"],
            ["Travel", 11],
            ["Advertisement", 2],
            ["Client-Expenses", 2],
            ["Out-sourcing", 2],
            ["Logistics", 7],
          ]}
          options={{
            title: "Expenses",
            legend: "none",
            pieSliceText: "label",
            slices: {
              4: { offset: 0.2 },
              12: { offset: 0.3 },
              14: { offset: 0.4 },
              15: { offset: 0.5 },
            },
          }}
          rootProps={{ "data-testid": "1" }}
        />
      </div>
    </div>
  );
};
export default EnterpriseTheme;
